from collections import Counter

class Solution(object):
    def findAnagrams(self, s, p):
        """
        :type s: str
        :type p: str
        :rtype: List[int]
        """
        res = []
        p_length = len(p)
        s_length = len(s)
        if p_length > s_length:
            return res
        p_counter = [0] * 26
        s_counter = [0] * 26

        for i in range(p_length):
            p_counter[ord(p[i]) - 97] += 1
            s_counter[ord(s[i]) - 97] += 1
        if p_counter == s_counter:
            res.append(0)

        for j in range(0, s_length - p_length):
            c_char = s[j]
            n_char = s[j + p_length]
            s_counter[ord(c_char) - 97] -= 1
            s_counter[ord(n_char) - 97] += 1
            if p_counter == s_counter:
                res.append(j + 1)
        return res


if __name__ == '__main__':
    s = Solution()
    print(s.findAnagrams("", ""))
